import React from 'react';
import './LandingPage.css'

const landingPage = () => {
  return(
  <div id="hero" className="jumbotron">
    <div className="container">
      <h1 className="hero-title load-hidden">
      <span className="text-color-main">Some corny flashcard app name</span> is a great way to learn software development if you enjoy studying the old fashion way!
      </h1>
      <p className="hero-cta load-hidden">
        <a className="cta-btn" href="#app">Start learning now!</a>
      </p>
    </div>
  </div>
  )
}

export default landingPage;
